import db from "./db.json";

export default function Index() {
  return (
    <div>
      {db.entries.map(({ body, title }, idx) => (
        <div key={idx}>
          <h2>{title}</h2>
          <div>{body}</div>
        </div>
      ))}
    </div>
  );
}
